import React from "react";
import { Link } from "react-router-dom";
import "./Nav.css";

const Nav = ()=>{
    return (
        <div className="navContainer">
            <ul>
                <li><i class="far fa-heart"></i></li>
                <li><i class="fal fa-home-lg-alt"></i></li>
                <li><Link><i class="fal fa-shopping-cart"></i></Link></li>
            </ul>
        </div>
    )
}
export default Nav;
